package parsers

import kotlinx.coroutines.runBlocking
import org.junit.jupiter.api.Tag
import org.junit.jupiter.api.assertDoesNotThrow
import de.mickkc.vibin.parsing.Parser
import de.mickkc.vibin.utils.ChecksumUtil
import kotlin.test.Test
import kotlin.test.assertEquals
import kotlin.test.assertNotNull
import kotlin.test.assertNull


class ImageDownloaderRestTest {

    @Test
    @Tag("network")
    fun testImageDownloadExternal() {
        val downloaded = runBlocking {
            Parser.downloadCoverImage("https://uploads.wtf/c/test/mick.png")
        }
        assertNotNull(downloaded)
        assertEquals("085e9292a8ecaae27509e8a980f90889", ChecksumUtil.getChecksum(downloaded))
    }

    @Test
    fun testImageDownloadBase64() {
        val test = "data:image/png;base64,"

        val downloaded = runBlocking {
            Parser.downloadCoverImage(test)
        }

        assertNotNull(downloaded)
        assertEquals("4d562d8a9ab5f157e2d99960c489e478", ChecksumUtil.getChecksum(downloaded))
    }

    @Test
    fun testImageDownloadInvalidUrl() {
        val downloaded = assertDoesNotThrow { runBlocking {
            Parser.downloadCoverImage("bruh")
        }}

        assertNull(downloaded)
    }

    @Test
    fun testImageDownloadEmptyUrl() {
        val downloaded = assertDoesNotThrow { runBlocking {
            Parser.downloadCoverImage("")
        }}

        assertNull(downloaded)
    }
}